import React from 'react'
import { Route, Routes } from 'react-router-dom'
import Examresult from '../Student_123/Pages/Examresult'

const Admin1 = () => {
  return (
    <div>
      <Routes>
        <Route path='/examresult' element={<Examresult/>}/>
      </Routes>
    </div>
  )
}

export default Admin1
